def getCelestialBody(target):
    if target in moons:
        return None

    url = "https://ssd.jpl.nasa.gov/api/horizons.api?format=json&COMMAND=%27TARGETBODY%27&OBJ_DATA=%27YES%27&MAKE_EPHEM=%27YES%27&EPHEM_TYPE=%27VECTORS%27&CENTER=%27500@0%27&START_TIME=%27STARTTIME%27&STOP_TIME=%27ENDTIME%27&STEP_SIZE=%271%20min%27&VEC_TABLE=%272%27&VEC_LABELS=%27NO%27&CSV_FORMAT=%27YES%27"
    url = url.replace("TARGETBODY", target)
    url = url.replace("STARTTIME", "2024-01-01%2000:00")
    url = url.replace("ENDTIME", "2024-01-01%2000:01")
    r = requests.get(url)
    data = json.loads(r.text)
    text = json.dumps(data["result"]).replace("\"","").replace("\\n","\n")
    with open("out.txt", "w") as file:
        file.write(text)

    lines = text.split("\n")
    physical = 0
    positional = False

    x = None
    y = None
    z = None
    xV = None
    yV = None
    zV = None
    radius = None
    mass = None
    name = None
    raw = text

    massFound = False
    radiusFound = False
    positionFound = False
    nameFound = False
    for line in lines:
        if "Target body name" in line:
            name = line.split("Target body name: ")[1].split(" ")[0]    
            nameFound = True
        if "PHYSICAL DATA" in line:
            physical = 1
        if "SATELLITE PHYSICAL" in line:
            physical = 2
        if "Calendar Date (TDB)" in line:
            positional = True
        if physical == 1:
            try:
                if "Vol. mean radius" in line:
                    scale = 1000 #assume its in kilometers int(line.split("(")[1].split(")")[0].replace("km","1000").replace("m","1"))
                    radius = float(re.match("^[0-9]*\\.?[0-9]*",line.replace(" ", "").split("=")[1]).group())
                    radius *= scale
                    radiusFound = True
                    if massFound:
                        physical = False
                if "Mass" in line and "x10^" in line:
                    scale = int(line.replace(" ", "").split("x10^")[1].split("kg")[0].replace("(",""))
                    mass = float(re.match("^[0-9]*\\.?[0-9]*", line.replace(" ","").split("Mass")[1].split("=")[1]).group())
                    mass = math.pow(10,scale) * mass
                    massFound = True
                    if radiusFound:
                        physical = False
            except:
                pass
        elif physical == 2:
            try:
                if "Radius" in line or "radius" in line:
                    scale = 1000 #still assuming
                    if "x" in line.split("=")[1]:
                        radius = float(line.replace(" ","").split("=")[1].split("x")[1])
                    else:
                        radius = float(re.match("^[0-9]*\\.?[0-9]*", line.replace(" ","").split("=")[1]).group())
                    radius *= scale
                    radiusFound = True
                    if massFound:
                        physical = False
                if "Mass" in line:
                    scale = int(line.replace(" ","").split("10^")[1].split("kg")[0])
                    if(len(line.replace(" ","").split("10^")) > 2):
                        scale += int(line.replace(" ","").split("10^")[2].split(")")[0])
                    if not re.match("^[0-9]*\\.?[0-9]*", line.replace(" ","").split("Mass")[1].split("=")[1]).group() == "":
                        mass = float(re.match("^[0-9]*\\.?[0-9]*", line.replace(" ","").split("Mass")[1].split("=")[1]).group())
                        mass = math.pow(10, scale) * mass
                        massFound = True
                        if radiusFound:
                            physical = False
                if "GM" in line:
                    # https://en.wikipedia.org/wiki/Standard_gravitational_parameter 
                    standardGravitationalParameter = float(re.match("^[0-9]*\\.?[0-9]*", line.replace(" ","").split("GM")[1].split("=")[1]).group())
                    standardGravitationalParameter *= 1000**3
                    mass = standardGravitationalParameter / 6.67430E-11
                    massFound = True
                    if radiusFound:
                        physical = False
            except:
                pass
        if positional:
            try:    
                if re.match("^[0-9]*\\.?[0-9]*, A\\.D\\.",line) != None:
                    x = float(line.replace(" ", "").split(",")[2]) * 1000
                    y = float(line.replace(" ", "").split(",")[3]) * 1000
                    z = float(line.replace(" ", "").split(",")[4]) * 1000
                    xV = float(line.replace(" ", "").split(",")[5]) * 1000
                    yV = float(line.replace(" ", "").split(",")[6]) * 1000
                    zV = float(line.replace(" ", "").split(",")[7]) * 1000
                    positionFound = True
                    positional = False
            except:
                pass
        if massFound and radiusFound and positionFound and nameFound:
            break
    if not massFound or not radiusFound and not name == None:
        print("Fallback on orbiterwiki.org")
        if len(name) >= 5:
            if name[0].isdigit() and name[1].isdigit() and name[2].isdigit() and name[3].isdigit() and not name[4].isdigit():
                name = "S/" + name[0] + name[1] + name[2] + name[3] + "_" + name[4] + "_" + name[5:]
        request = requests.get(f"https://www.orbiterwiki.org/wiki/{name}")
        if request.status_code == 200:
            try:
                #TODO Check for km as radius instead
                scale = 1
                if "k" in request.text.split("<td width=\"30%\">Mean radius</td>")[1].split("<td align=\"right\" width=\"30%\">")[1].split("</td>")[0]:
                    scale = 1000
                radius = int(request.text.split("<td width=\"30%\">Mean radius</td>")[1].split("<td align=\"right\" width=\"30%\">")[1].split("</td>")[0].replace(" ","").replace("k","").replace("m","")) * scale
                radiusFound = True
                scale = int(request.text.split("<td width=\"30%\">Mass</td>")[1].split("<td align=\"right\" width=\"30%\">")[1].split("×10<sup>")[1].split("</sup>")[0])
                mass = float(request.text.split("<td width=\"30%\">Mass</td>")[1].split("<td align=\"right\" width=\"30%\">")[1].split("×10")[0])
                mass = math.pow(10, scale) * mass
                massFound = True
            except Exception as e:
                print(e)
                pass
    if not massFound or not radiusFound or not positionFound or not nameFound:
        print("Could not find " + target)
        print("Name: ",nameFound, ": ", name)
        print("Mass: ",massFound, ": ", mass)
        print("Radius: ",radiusFound, ": ", radius)
        print("Position: ",positionFound, ": ", x, " ", y, " ",z, " ",xV, " ",yV, " ",zV, " ",)
        pyperclip.copy("\""+ target+ "\"" + ":{\"name\":\"" + name + "\",\"mass\":" + str(mass) + ",\"radius\":" + str(radius) + ",\"x\":" + str(x) + ",\"y\":" + str(y) + ",\"z\":" + str(z) + ",\"xV\":" + str(xV) + ",\"yV\":" + str(yV) + ",\"zV\":" + str(zV) + ",\"raw\":\"" + raw.replace("\n","\\n").replace("\\T","\\\\T").replace("\\G","\\\\G").replace("\\ ","\\\\ ") + "\"},")
        raise Exception("Missing information")
        #sys.exit()
    return {"name": name,"mass":mass, "radius":radius, "x":x, "y":y, "z":z, "xV":xV, "yV":yV, "zV":zV, "raw":raw}


